import AdminSidebar from "./admin_sidebar";
import './admin_sidebar.css';
const MainAdmin=()=> {
    const [selectedItem, setSelectedItem] = useState('');
    const handleItemClick = (item) => {
        setSelectedItem(item);
      };
      let content;

  switch (selectedItem) {
    case 'home':
      content = <Home />;
      break;
    case 'about':
      content = <About />;
      break;
    case 'services':
      content = <Services />;
      break;
    case 'contact':
      content = <Contact />;
      break;
    default:
      content = <div>Please select an item from the sidebar.</div>;
  }
    return (
      <div className="admin_main_app-container">
        <AdminSidebar onItemClick={handleItemClick} />
        <div className="admin_main_main-content">
          {/* Your main content here */}
          {content}
          {/* <Route path='/addhotel' component={AddHotelForm} /> */}
        </div>
      </div>
    );
  }
  
  export default MainAdmin;
